import Wrapper from '../UI/WrapperNoColor';
import classes from './NewsList.js';

const NewsList = () => {
  return (
    <Wrapper>
      <div className={classes.title}>
        <h2>TECH NEWS</h2>
        <div className={classes["title-underline"]} />
      </div>
      <div className={classes.articles}></div>
    </Wrapper>
  )
};

export default NewsList;
